(100107, 'www.ypippijkt.sch.id', 'Informasi Ujian Seleksi PPDB 2018-2019', 'informasi-ujian-seleksi-ppdb-2018-2019', '<h2 style=\"border: 0px; padding: 0px; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18px; color: rgb(85, 85, 85); text-align: center;\"><br></h2><h2 style=\"border: 0px; padding: 0px; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18px; color: rgb(85, 85, 85);\"><strong style=\"border: 0px; padding: 0px;\">Unit SMP :</strong></h2><ul style=\"border: 0px; padding: 0px 0px 0px 15px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, Helvetica; font-size: 13px;\"><li style=\"border-top: 0px; border-right: 0px; border-bottom: none; border-left: 0px; border-image: initial; padding: 15px 0px;\">Calon siswa baru harus mengikuti ujian tertulis yang terdiri materi soal campuran&nbsp;<strong style=\"border: 0px; padding: 0px;\">(matematika, IPA, Pengetahuan Umum, B. Indonesia, &amp; B. Inggris materi SD).</strong></li><li style=\"border-top: 0px; border-right: 0px; border-bottom: none; border-left: 0px; border-image: initial; padding: 15px 0px;\">Untuk calon siswa pindahan, materi ujian tertulis adalah soal-soal umum yang telah dipelajari di kelas sebelumnya</li><li style=\"border: 0px; padding: 15px 0px;\">Calon siswa didampingi oleh Orang tua harus mengikuti test wawancara dengan Guru SMP, berkaitan dengan peraturan Tata Tertib &amp; Budaya Sekolah.&nbsp;</li></ul><h2 style=\"border: 0px; padding: 0px; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18px; color: rgb(85, 85, 85);\"><strong style=\"border: 0px; padding: 0px;\">Unit SMA :</strong></h2><ul style=\"border: 0px; padding: 0px 0px 0px 15px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, Helvetica; font-size: 13px;\"><li style=\"border-top: 0px; border-right: 0px; border-bottom: none; border-left: 0px; border-image: initial; padding: 15px 0px;\">Calon siswa baru harus mengikuti&nbsp;ujian tertulis yang terdiri materi soal campuran yaitu&nbsp;<strong style=\"border: 0px; padding: 0px;\">Matematika, Bahasa Indonesia, Bahasa Inggris, &amp; Mata Pelajaran Umum (IPA &amp; IPS) materi SMP.</strong></li><li style=\"border-top: 0px; border-right: 0px; border-bottom: none; border-left: 0px; border-image: initial; padding: 15px 0px;\">Untuk calon siswa pindahan, materi ujian tertulis adalah soal-soal umum yang telah dipelajari di kelas sebelumnya</li><li style=\"border: 0px; padding: 15px 0px;\">Calon siswa didampingi oleh Orang tua harus mengikuti test wawancara dengan Guru SMA, berkaitan dengan peraturan Tata Tertib &amp; Budaya Sekolah.&nbsp;</li></ul><h2 style=\"border: 0px; padding: 0px; font-family: &quot;Open Sans&quot;, sans-serif; font-size: 18px; color: rgb(85, 85, 85);\"><strong style=\"border: 0px; padding: 0px;\">Unit SMK :&nbsp;</strong></h2><ul style=\"border: 0px; padding: 0px 0px 0px 15px; color: rgb(85, 85, 85); font-family: &quot;Open Sans&quot;, Arial, Helvetica; font-size: 13px;\"><li style=\"border-top: 0px; border-right: 0px; border-bottom: none; border-left: 0px; border-image: initial; padding: 15px 0px;\">Calon siswa baru harus mengikuti&nbsp;ujian tertulis yang terdiri materi soal campuran&nbsp;<strong style=\"border: 0px; padding: 0px;\">(Matematika, Bahasa&nbsp;Indonesia, &amp; Bahasa&nbsp;Inggris materi SMP).</strong></li><li style=\"border-top: 0px; border-right: 0px; border-bottom: none; border-left: 0px; border-image: initial; padding: 15px 0px;\">Untuk calon siswa pindahan, materi ujian tertulis adalah soal-soal umum yang telah dipelajari di kelas sebelumnya</li><li style=\"border: 0px; padding: 15px 0px;\">Calon siswa didampingi oleh Orang tua harus mengikuti test wawancara dengan Guru SMK, berkaitan dengan peraturan Tata Tertib &amp; Budaya Sekolah.&nbsp;</li></ul>', 'demo, berita', ',26939,', '1', '0', '1', '1', '0', '0', '0', '0', '0', 131, '26180690ppdb.jpg', '2018-04-24 12:44:20', '1'),
(100293, 'www.ypippijkt.sch.id', 'INFORMASI WISUDA / PELEPASAN SMA-SMK YP IPPI PETOJO & CAKUNG', 'informasi-wisuda--pelepasan-sma-smk-yp-ippi-petojo--cakung', '<p class=\"MsoNormal\" align=\"center\" style=\"margin: 15.75pt 0in 7.9pt; text-align: center; line-height: normal; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><b><span style=\"font-family: Andalus, serif; color: rgb(34, 34, 34);\"><font size=\"2\">UNDANGAN WISUDA/PELEPASAN<o:p></o:p></font></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-indent: 0.25in; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><font size=\"2\"><span style=\"line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34); border: 1pt none windowtext; padding: 0in;\">Setelah melalui perjuangan yang\r\npanjang, siswa-siswi kelas XII telah menyelesaikan pendidikannya di SMA dan SMK\r\nYP IPPI Petojo &amp; Cakung ( JAKARTA) selama 3 tahun, dan telah mengikuti\r\nserangkaian kegiatan mulai USBN &amp; UNBK, dengan hasil&nbsp;<b style=\"\">LULUS 100%.</b></span><span style=\"line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34);\"><o:p></o:p></span></font></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-indent: 0.25in; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34);\"><font size=\"2\">&nbsp;<span style=\"border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\r\npadding:0in\">Selamat untuk kalian semua siswa-siswi &nbsp;kelas XII semoga keberhasilan ini merupakan\r\nawal dari kesuksesan dimasa yang akan datang.</span><o:p></o:p></font></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-indent: 0.25in; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34);\"><font size=\"2\">&nbsp;<span style=\"border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\r\npadding:0in\">Dalam rangka mengakhiri kegiatan pendidikan di SMA dan SMK YP IPPI\r\nPetojo &amp; Cakung ( JAKARTA), mengharap atas kehadiran siswa-siswi &nbsp;XII pada :</span></font></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; text-indent: 0.25in; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><span style=\"line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34);\"><font size=\"2\"><span style=\"border:none windowtext 1.0pt;mso-border-alt:none windowtext 0in;\r\npadding:0in\"><br></span></font></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom: 0.0001pt; line-height: 150%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; vertical-align: baseline;\"><font size=\"2\"><b><span style=\"line-height: 150%; font-family: Andalus, serif; color: rgb(34, 34, 34); border: 1pt none windowtext; padding: 0in;\">Hari/\r\nTanggal&nbsp; &nbsp;