(218396, 'www.ypippijkt.sch.id', 'Sejarah', 'sejarah', 'tulis', 0, 'Ini adalah contoh sejarah singkat sekolah<br>\r\n							SMA Negeri 1 Harapan berdiri sejak tanggal 1 November tahun 1877. Terletak di Jalan Bodjong 149 (Jl. Pemuda 149). Mula-mula adalah HBS (Hogere Bunger School). Pada tahun 1930 dipergunakan untuk untuk HBS dan AMS (Algemene Meddelbare School), kemudian tahun 1937 HBS pindah di jalan Oei Tong Ham (sekarang Jl Menteri Supeno No. 1 / SMU 1 Harapan), sedangkan bangunan di jalan Bodjong dipergunakan untuk AMS dan MULO.Pada zaman pendudukan Jepang bangunan ini dipergunakan untuk SMT (Sekolah Menengah Tinggi).', 'sejarah', '1', '1', '1', '0', '0', '0', '0', '0', '0', 30, '', 1, 218389, '0', '2018-05-01 13:30:16', '1'),
(218397, 'www.ypippijkt.sch.id', 'Struktur Organisasi', 'struktur-organisasi', 'tulis', 0, '<img alt=\"struktur\" src=\"https://mysch.id/cms/picture/str1.jpg\" width=\"100%\">', 'struktur organisasi', '1', '1', '1', '0', '0', '0', '0', '0', '0', 33, '', 3, 218389, '0', '2018-05-02 10:14:59', '1'),
(218398, 'www.ypippijkt.sch.id', 'OSIS SMK YP IPPI CAKUNG', 'osis-smk-yp-ippi-cakung', 'tulis', 0, 'Ini adalah contoh Struktur OSIS Sekolah:<br>\r\n							<br>Ketua OSIS : Gia Haryza <br>Wakil Ketua OSIS 1 : M. Isyraqi El-hakim\r\n							<br>Wakil Ketua OSIS 2 : Yunan Ahmad Taufik<br>Sekretaris Umum : Hanifah \r\n							<br>Sekretaris 1 : Ridho Agung Nugraha <br>Sekretaris 2 : Afriani Naidza Nurdianti\r\n							<br>Bendahara Umum : Ginar Amalia Hidayati<br>Bendahara 1 : Ria Maria Nurhayati\r\n							<br>Bendahara 2 : Nada Fathia Mutiara', 'struktur osis', '1', '1', '1', '0', '0', '0', '0', '0', '0', 43, '', 1, 218390, '0', '2018-05-01 13:47:51', '1'),
(218399, 'www.ypippijkt.sch.id', 'Ekstrakurikuler', 'ekstrakurikuler', 'tulis', 0, '<p>Ini adalah contoh Struktur OSIS Sekolah:</p>\r\n							<p>Kegiatan ekstrakurikuler merupakan salah satu alat pengenalan siswa pada hubungan sosial. Di dalamnya terdapat pendidikan pengenalan diri dan pengembangan kemampuan selain pemahaman materi pelajaran.</p>\r\n							<p>Selain OSIS sebagai induk kegiatan ektrakurikuler di sekolah, kegiatan ektrakurikuler lainnya adalah:</p>\r\n							<ul>\r\n								<li>Pramuka</li>\r\n								<li>Paskibra</li>\r\n								<li>Palang Merah Remaja (PMR)</li>\r\n								<li>Patroli Keamanan Sekolah (PKS)</li>\r\n								<li>Pecinta Alam (PA)</li>\r\n							</ul>', 'ekstrakurikuler', '', '', '', '', '', '', '', '', '', 58, '', 4, 218390, '0', '2018-05-04 08:23:21', '1'),
(218400, 'www.ypippijkt.sch.id', 'Pendaftaran', 'pendaftaran', 'tulis', 0, 'Maaf, Halaman ini masih kosong', 'pendaftaran', '1', '1', '1', '0', '0', '0', '0', '0', '0', 57, '', 1, 218391, '0', '2018-05-01 14:00:39', '1'),
(218401, 'www.ypippijkt.sch.id', 'Beasiswa', 'beasiswa', 'tulis', 0, 'Ini adalah contoh halaman beasiswa<br>\r\n							Beasiswa yang ada di SMK 1 Harapan adalah:<br>\r\n							<b>Beasiswa Program Peningkatan Akademik (PPA)</b><br>\r\n							Beasiswa Program Peningkatan Akademik (PPA) ini diberikan kepada siswa/siswi SMK CINTA INDONESIA yang memiliki peringkat terbaik di masing masing program keahlian/jurusan. Beasiswa PPA ini diberikan setiap 1 semester sekali, dengan nominal Rp. 325.000 - Rp. 225.000 / siswa.', 'beasiswa', '1', '1', '1', '0', '0', '0', '0', '0', '0', 29, '', 2, 218391, '0', '2018-05-01 14:00:58', '1'),
