(19433, 'www.ypippijkt.sch.id', 0, 0, 0, 'AveryLef', '', '83563998472', 'raphaeToomscib@gmail.com', '', 'Hi!  ypippijkt.sch.id \r\n \r\nHave you ever heard of sending messages via contact forms? \r\n \r\nThink of that your message will be readread by hundreds of thousands of your probable buyerscustomers. \r\nYour message will not go to the spam folder because people will send the message to themselves. As an example, we have sent you our suggestion  in the same way. \r\n \r\nWe have a database of more than 30 million sites to which we can send your offer. Sites are sorted by country. Unfortunately, you can only select a country when sending a message. \r\n \r\nThe cost of one million messages 49 USD. \r\nThere is a discount program when you buy  more than two million message packages. \r\n \r\n \r\nFree proof mailing of 50,000 messages to any country of your selection. \r\n \r\n \r\nThis letter is created automatically. Please use the contact details below to contact us. \r\n \r\n \r\n \r\nContact us. \r\nTelegram - @FeedbackFormEU \r\nSkype  FeedbackForm2019 \r\nEmail - Contact@feedbackmessages.com', '2019-09-11 02:58:59', '0'),
(19434, 'www.ypippijkt.sch.id', 0, 0, 0, 'Tim ScanForm', '', 'Tim ScanForm', 'scanform.id@gmail.com', '', 'YTH.\r\nPengelola SMA/SMK YP IPPI Jakarta\r\n\r\nSalam,\r\n\r\nKami sekelompok programmer dari Indonesia, ingin memberikan andil dalam peningkatan kualitas proses belajar mengajar di Indonesia. Kami telah membuat aplikasi web gratis untuk memeriksa hasil ujian beserta analisis butir soal ujian. Kami berharap alat bantu ini bisa membantu sekolah dan guru dalam meningkatkan efisiensi dan mempercepat proses evaluasi belajar mengajar.\r\n\r\nAlat bantu untuk memeriksa hasil ujian bisa digunakan secara online dan gratis di situs web https://scan-form.github.io\r\n\r\nSemoga alat bantu ini bisa memberikan sumbangsih nyata ke dunia pendidikan di negara tercinta ini.\r\n\r\nTerimakasih,\r\n\r\nTim ScanForm.', '2019-09-11 18:03:20', '0'),
